<script language=JavaScript><!--
window.onload = function(){ 
function timer(){
var hour = document.getElementById('hour').innerHTML;
var minute = document.getElementById('minute').innerHTML;
var second = document.getElementById('second').innerHTML;

var end = false;
if( second > 0 ) second--;
else{
second = 59;
if( minute > 0 ) minute--;
else{
second = 59;
if( hour > 0 ) hour--;
else end = true;
}}
if( minute == 0 && second < 5 ){
clearInterval(intervalID);
document.getElementById("stop").style.display = 'block';
var starts = 4
document.getElementById("scnds").innerHTML = starts;
setInterval(function(){
starts--;
if (starts < 0) {
document.location = "stop.htm";
}
else {
document.getElementById("scnds").innerHTML = starts;}
}, 1000)
}else{
document.getElementById('hour').innerHTML = hour;
document.getElementById('minute').innerHTML = minute;
document.getElementById("sc").style.display = 'inline-block';
if( second < 10 ){
document.getElementById("scs").style.display = 'inline-block';
document.getElementById('second').innerHTML = second;}
else{
document.getElementById("scs").style.display = 'none';
document.getElementById('second').innerHTML = second;}
}}
window.intervalID = setInterval(timer, 1000);
}
//--></script>
<script language=JavaScript><!--
document.oncontextmenu = cmenu; function cmenu() {return false;}
function preventSelection(element){
var preventSelection = false;
function addHandler(element, event, handler){
if (element.attachEvent) element.attachEvent('on' + event, handler);
else if (element.addEventListener) element.addEventListener(event, handler, false);}
function removeSelection(){
if (window.getSelection) {window.getSelection().removeAllRanges();}
else if (document.selection && document.selection.clear)
document.selection.clear();
}
addHandler(element, 'mousemove', function(){if(preventSelection) removeSelection();});
addHandler(element, 'mousedown', function(event){var event = event || window.event; var sender = event.target || event.srcElement; preventSelection = !sender.tagName.match(/INPUT|TEXTAREA/i);});
function killCtrlA(event){
var event = event || window.event;
var sender = event.target || event.srcElement;
if (sender.tagName.match(/INPUT|TEXTAREA/i)) return;
var key = event.keyCode || event.which;
if ((event.ctrlKey && key == 'U'.charCodeAt(0)) || (event.ctrlKey && key == 'A'.charCodeAt(0)) || (event.ctrlKey && key == 'S'.charCodeAt(0)))
{removeSelection();
if (event.preventDefault) event.preventDefault();
else event.returnValue = false;}}
addHandler(element, 'keydown', killCtrlA);
addHandler(element, 'keyup', killCtrlA);
}
preventSelection(document);
//--></script>
